window.bookSummaryJSON = "<p>Gretch Wolgast still can’t forgive Shaq for abandoning her beloved Orlando Magic, but she is moving on with her life. Two years after she helped foil a plot to destroy her and her fellow OP - the telekinetics born in Orlando in the early 1980s - she's become a federal agent investigating OP-related crime. But her boss really doesn’t seem to like her. And now she’s being forced to attend a dinner on a mysterious billionaire's yacht in South Florida.</p> <p>Gretch barely has time to dive into the appetizers before things get weird. And deadly.</p> <p>Reunited with her old friend Special Agent Frank Prater, Gretch needs to find a killer and save the lives of everyone on board. Not so easy when each passenger is a suspect - and each is harboring a secret.</p>"; 
